output_description:
Design a computational model for the given task. The model should obtain the utility, (not the probability of choosing an action).  Your goal is to eventually explore the entire space of possible explainations and mechanisms by which the observed behavior arises.

Your model should use the given variables appropriately, but does not necessary need to use all or even most of the variables. Do not include the model for the utility of rejecting an offer. 

The model should:
1. Predict only responder behavior.
2. Build on relevant psychological principles.
3. Be considerate of high covariance between learnable parameters as the model
will have to pass parameter recovery tests.
4. Be applicable to the dataset given within the task description (i.e. the model should be able to be run using only the provided dataset structure).
5. Not include parameters to simulate general stochasticity of behavior, because this will be handled later by a temperature parameter.
6. Should have no more than two learnable parameters.
7. This specific model should calculate the utility of an action, which will then be used to determine
the probability of choosing that action. Negative values should represent a negative utility, and thus an unlikly action.

For any learnable parameters in your model, you must specify finite numerical bounds (it just can not be infinity) in the variable descriptions. However, this bound should be generous. The utility variable may be unbounded (-inf to inf).

First, reason step by step about:
* The key psychological mechanisms involved
* How these mechanisms interact
* What mathematical form could capture these interactions
* What parameters would be needed to calibrate the model
* How the model variables map to observable behavior

Then, provide your formal mathematical model between <MODEL> tags, followed by variable descriptions between <VARIABLES> tags. Use clear mathematical notation and ensure each variable is fully described. Every variable must be utilized within the mathematical formula provided between <MODEL> and </MODEL>. For variable descriptions, provide them in a JSON format with the following structure: <VARIABLES> Bounds are by default inclusive. Please spell out the greek variable names instead of using the symbols. Finally, you should provide a short description of the model in the summary tags <SUMMARY> </SUMMARY>. This will be used to compare different computational models of the task; it should be concise and purely descriptive. Do not include generic information about the name of the tasks, since that is implied. 

{
  "variables": {
    "variable_name": {
      "description": "Clear description",
      "range": {
        "min": value,
        "max": value,
        "inclusive_min": boolean,
        "inclusive_max": boolean
      },
      "distribution": {
        "type": "distribution type",
        "parameters": {}
      },
      "learnable": boolean,
      "source": "learnable/data/calculated"
    }
  }
}
</VARIABLES>

Example #1: 
<EXAMPLE>
(Model of a Random Choice Task):
Let me think through this step by step...
[your reasoning here]

<MODEL>
U_i = β + εE + ηN
</MODEL>

<VARIABLES>
{
  "variables": {
    "U_i": {
      "description": "Utility of choosing action i",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "beta": {
      "description": "Base tendency parameter (inherent preference)",
      "range": {
        "min": 0,
        "max": 1
      },
      "learnable": true,
      "source": "learnable"
    },
    "epsilon": {
      "description": "Environmental sensitivity parameter",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": true,
      "source": "learnable"
    },
    "E": {
      "description": "Environmental cue value",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    },
    "eta": {
      "description": "Noise parameter",
      "range": {
        "min": 0,
        "max": 1,
        "exclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "N": {
      "description": "Random noise drawn from normal distribution N(0,1)",
      "distribution": {
        "type": "normal",
        "mean": 0,
        "std": 1
      },
      "learnable": false,
      "source": "calculated"
    }
  }
}
</VARIABLES>
<SUMMARY>
A linear utility model combining base preference, environmental influence, and stochastic noise. The model uses two learnable parameters: a base tendency parameter (β) constrained to [0,1] and an unconstrained environmental sensitivity parameter (ε). Environmental cues and normally distributed noise modify the base utility, allowing for both systematic and random variation in choice behavior.
</SUMMARY>
</EXAMPLE>

Please be sure to provide the mathematical formula for the model between <MODEL> and </MODEL>, and the variable descriptions between <VARIABLES> and </VARIABLES>. No description of the model should be provided within the <MODEL> tags.

The parameter names you choose in your <VARIABLES> section will be used exactly as specified in subsequent code generation. Please choose clear, non-reserved parameter names that can be used directly in Python code. For example, avoid Python reserved words like 'lambda' and use alternatives like 'learning_rate' or 'lambda_param'. DO NOT USE 'lambda' AS A PARAMETER NAME.

You will be given the complete list of models that you have already created. Analyze the models, and notice the absence of possible explanations of behaviors that should be tested. You should start with simple obvious explanations, and as you notice these being thoroughly explored you should shift to fundamentally different models of behavior. Pay less attention to the names of the variables, and how they are actually interacting with the given behavioral data. Start with variables with no learnable parameters, and then shift to comprehensively explore the place with one learnable paramter, and then two, etc.

Your results will be scored on a combination of BIC with a penalization for number of learned parameters, the ability to recover those learned parameters, and the ability of those parameters to account for the differences in behaviors among varying groups of people.

Previous Models:
Model 1:
Specification: U_accept =  (split_perc_self / ((token_self / (token_self + token_opp)) * 100)) * fairness_weight + (split_self / combined_earning) * (1 - fairness_weight) - min_acceptable_perc
Summary: A utility model for responder behavior in an economic game, considering both fairness and self-interest. Utility is calculated as a weighted average of a fairness term (ratio of received percentage to contribution percentage) and a self-interest term (percentage of combined earnings received). A minimum acceptable percentage parameter accounts for situations where offers might be rejected even if fair due to being too small. The model uses two learnable parameters:  `fairness_weight` and `min_acceptable_perc`.

complete_model_interaction.output:
Let's design a computational model for responder behavior in this economic game.  We'll focus on two key psychological mechanisms:

1. **Equity Sensitivity:** Individuals differ in their sensitivity to inequitable outcomes. Some are more tolerant of receiving less than their perceived contribution, while others are more averse.  This will be captured by a single learnable parameter.

2. **Self-Interest:**  The amount of money received is a primary driver of acceptance.  The simple ratio of the offered amount to the total earnings will represent this.  We won't use a separate parameter for this as we want to keep it simple.

The interaction:  Equity sensitivity modulates the importance of the equity ratio relative to the self-interest (earnings) ratio.

Mathematical Form:  A weighted average of an equity term and a self-interest term.

Parameters:

1. **Equity Sensitivity (equity_sensitivity):** This parameter quantifies the participant's sensitivity to fairness. A higher value indicates greater aversion to inequitable outcomes.

Model Variables:

- Equity Term: This captures how fair the split is, considering individual contributions.  A ratio comparing the percentage of combined earnings received to the percentage of tokens contributed.
- Self-Interest Term: The percentage of total earnings that the responder would receive.

The utility of accepting will be a weighted average of these two components, governed by the equity sensitivity.

<MODEL>
U_accept = equity_sensitivity * (split_perc_self / ((token_self / (token_self + token_opp)) * 100)) + (1 - equity_sensitivity) * (split_self / combined_earning)
</MODEL>

<VARIABLES>
{
  "variables": {
    "U_accept": {
      "description": "Utility of accepting the proposed split.",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "equity_sensitivity": {
      "description": "Individual's sensitivity to inequitable outcomes. Higher values indicate greater aversion to inequity.",
      "range": {
        "min": 0,
        "max": 1,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    },
    "split_perc_self": {
      "description": "Percentage of combined earnings proposed for the participant.",
      "range": {
        "min": 0,
        "max": 100,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "token_self": {
      "description": "Number of tokens found by the participant.",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "token_opp": {
      "description": "Number of tokens found by the opponent.",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "split_self": {
      "description": "Proposed share for the participant (in £).",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "combined_earning": {
      "description": "Total amount of money earned.",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    }
  }
}
</VARIABLES>

<SUMMARY>
A utility model for responder behavior based on a weighted average of equity and self-interest.  The model uses one learnable parameter, `equity_sensitivity`, representing the individual's sensitivity to fairness.  The utility of accepting an offer is calculated as a weighted combination of the ratio of the received percentage to the contribution percentage and the percentage of total earnings received.
</SUMMARY>

